import React from 'react';
import { doSignOut } from '../firebase/FirebaseFunctions';
import Landing from './Landing';

const SignOutButton = () => {
	return (
		<button type='button' onClick = {async () => {<Landing/>;doSignOut}}>
			Sign Out
		</button>
	);
};

export default SignOutButton;
